import React,{useState,useEffect,useMemo} from 'react';
import NavbarAdmin from './adminNav';
import { Avatar, TextField, Typography } from '@mui/material';
import { Box } from '@mui/system';
import Autocomplete from '@mui/material/Autocomplete';

const AddSeller = () => {
  const regions = [
    { title: 'Oromia'},
    { title: 'AddisAbaba'},
    { title: 'Amhara'},
    { title: 'Afar' },
    { title: 'Somali' },
    { title: "Sidama" },
    { title: 'BenishangulGumuz'},
    { title: 'Gambella' },
    { title: "SNNP" },
    { title: 'DireDewa'}
]
    return ( 
        <>
          <NavbarAdmin/>
          <Box sx={{
        position:"absolute",
        top:"30%",
        left:"10%",
        width:"80%",
        backgroundColor:"white",

    }}>
        <form>
        <TextField label="Manager FirstName" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField> 
        <TextField label="Manager LastName"sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }}  ></TextField> 
        <br></br>
        <br></br>
        <TextField label="CompanyName" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField> 
        <TextField label="Phone No" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField>
        <br></br>
        <br></br>
        <Autocomplete
        id="Region"
        freeSolo
        options={regions.map((option) => option.title)}
        renderInput={(params) => <TextField {...params} label="Region" />}
      />
        <TextField label="PhoneNumber" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField>
        <br></br>
        <br></br>
        <TextField label="City" sx={{
            marginLeft:"20px",
            marginTop:"10px"
        }} ></TextField>
        <TextField label="Stream" sx={{
            marginLeft:"20px",
            marginTop:"10px",
            marginBottom:"30px"
        }} ></TextField>
        
        <button type="submit">Edit</button>
        
    </form>
    <br/>
    <br/>
    <br/>
        <div> ------</div>
    </Box>
        </>
     );
}
 
export default AddSeller;
